package projeto.beans;

public class TipoCausa {
	
	private int cdTipoCausa;
	private String dsTipoCausa;
	public TipoCausa() {
		super();
		// TODO Auto-generated constructor stub
	}
	public TipoCausa(int cdTipoCausa, String dsTipoCausa) {
		super();
		this.cdTipoCausa = cdTipoCausa;
		this.dsTipoCausa = dsTipoCausa;
	}
	public int getCdTipoCausa() {
		return cdTipoCausa;
	}
	public void setCdTipoCausa(int cdTipoCausa) {
		this.cdTipoCausa = cdTipoCausa;
	}
	public String getDsTipoCausa() {
		return dsTipoCausa;
	}
	public void setDsTipoCausa(String dsTipoCausa) {
		this.dsTipoCausa = dsTipoCausa;
	}

	
	

}
